import styled from 'styled-components';

const Header = styled.header`
    background-color: #fff;
    border-bottom: 5px solid #000;
    box-sizing: border-box;
    padding: 16px 24px;
    position: fixed;
    top: 0px;
    width: 100%;
`;

export default Header;
